/*文字打印效果*/
Element.prototype.typewriter=function(a){
			var d = this,
				c = d.innerHTML,
				b = 0;
			d.innerHTML="";
			var e = setInterval(function() {
				var f = c.substr(b, 1);
				if (f == "<") {
					b = c.indexOf(">", b) + 1
				} else {
					b++
				}
				d.innerHTML=c.substring(0, b) + (b & 1 ? "_" : "");
				if (b >= c.length) {
					clearInterval(e)
				}
			}, 100)
		return this
	
	}

/*背景轮播*/
var bj2=1;
	function bj(){
		var newurl="url(img/banner2"+bj2+".jpg)";
		$("#list-one").animate({opacity:"0"},500);

		$("#list-one").animate({opacity:"1"},500);
			$("#list-one").css("background-image",newurl);
		
		
		bj2++;
		bj2==5&&(bj2=1);
	}
	bj();
	var timer=setInterval(bj,5000);

