/*工具块*/
	$(".two-nr-box").click(function(event){
		event.stopPropagation();
	if($(".xsyc").length==0){	
			$(".jn2").show(200);
			$(".jn2 ").addClass("xsyc");
			$(".jineng-logo div").addClass("xsyc2");
			}
		else{
			$(".jn2").hide(200);
			$(".jn2 ").removeClass("xsyc");
			$(".jineng-logo div").removeClass("xsyc2");
		}
		
	});
